import React from "react";
import LoginForm from "../../components/LoginForm/LoginForm";
import Layout from "../../components/Layout";
import "../admin-pages/AdminLogin.css";

function AdminLogin() {
  return (
    <>
      <Layout>
        <div className = "admin-login-page-container">

          <div className="background-image-container-left"></div>

          <div className="login-form-container-right">

          <h3 className = 'login-form-title'>Welcome</h3>
          <p>Please, submit your Login data fill the form to access your admin panel.</p>
          <LoginForm />
        </div>

        </div>


      </Layout>
    </>
  );
}

export default AdminLogin;
